import {
  Paper,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
} from "@mui/material";
import ApplicationState from "PropagandaSysteem/src/ApplicationLayer/ApplicationState";
import { VerkrijgDeelnemersFromRaceResponse } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/Race/RaceResponses";
import { verkrijgDeelnemersFromRace } from "PropagandaSysteem/src/ApplicationLayer/Organisatie/Race/RaceUseCases";
import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";

export default function DeelnemersTable() {
  const params = useParams();
  const [deelnemers, setDeelnemers] = useState<
    VerkrijgDeelnemersFromRaceResponse | undefined
  >(undefined);

  useEffect(() => {
    setDeelnemers(
      verkrijgDeelnemersFromRace(
        {
          raceTitle: params.raceTitle!,
        },
        ApplicationState.getInstance()
      )
    );

    console.log(deelnemers);
  }, []);

  return (
    <TableContainer component={Paper} sx={{ marginBottom: 2 }}>
      <Table sx={{ minWidth: 650 }} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell>Lane</TableCell>
            <TableCell align="right">Naam</TableCell>
            <TableCell align="right">Category</TableCell>
            <TableCell align="right">Club</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {deelnemers?.deelnemers?.map((deelnemer, index) => (
            <TableRow
              key={index}
              sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
            >
              <TableCell>{deelnemer.baan}</TableCell>
              <TableCell align="right">{baanVerdeling.naam}</TableCell>
              <TableCell align="right">{baanVerdeling.category}</TableCell>
              <TableCell align="right">{baanVerdeling.club}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
